import{_ as i}from"./chunks/theme.BBnZaxT7.js";import{_ as t,a as o,f as e,H as a,o as r}from"./chunks/framework.Cao6T-Ti.js";const k=JSON.parse('{"title":"ADX Портлэнд, США","description":"","frontmatter":{"title":"ADX Портлэнд, США","date":"2015-05-03","cover":"worktogetherday.jpg","icon":"logo.png","vimeo":"https://vimeo.com/50714619","toc":true},"headers":[],"relativePath":"theory/research/adx-portland/index.md","filePath":"theory/research/adx-portland/index.md"}'),h={name:"theory/research/adx-portland/index.md"},n=a('<blockquote><p>Представляем вашему вниманию перевод основной информации с сайта еще одной американской открытой мастерской – ADX, расположенной в Портлэнде, штат Орегон. <a href="http://www.adxportland.com/" class="external-link" target="_blank" rel="noreferrer">http://www.adxportland.com/</a></p></blockquote><h1 id="об-adx" tabindex="-1">Об ADX <a class="header-anchor" href="#об-adx" aria-label="Permalink to &quot;Об ADX&quot;">​</a></h1><p>ADX — это центр сотрудничества, где лица и организации творят и учатся. Делясь инструментами, знаниями и опытом, мы делаем вещи лучше — работаем сообща. Наше творческое пространство, учебный центр и производственная площадка позволяют каждому реализовать свои идеи. В нашем здании площадью 14 000 кв. футов дизайнеры высокого профиля работают бок о бок со студентами, пенсионеры делятся знаниями с новичками, а предприниматели сотрудничают с теми, для кого создание вещей — только хобби.</p><h1 id="публичные-туры" tabindex="-1">Публичные туры <a class="header-anchor" href="#публичные-туры" aria-label="Permalink to &quot;Публичные туры&quot;">​</a></h1><p>Заинтересованы в нашем пространстве, возможностях, классах или мастерских? Приходите и присоединяйтесь к нашим регулярным вводным экскурсиям, проходящим три раза в неделю.</p><ul><li>Понедельник: 18:00</li><li>Среда: 10:00</li><li>Пятница: 10:00</li></ul><p>Группы больше 4 человек согласовывают время посещения с нами. Возможна организация персональных экскурсий и туров вне графика.</p><h3 id="техника-безопасности" tabindex="-1">Техника безопасности <a class="header-anchor" href="#техника-безопасности" aria-label="Permalink to &quot;Техника безопасности&quot;">​</a></h3><p>Все наши члены обязательно изучают технику безопасности, чтобы иметь возможность работать в мастерской уверенно и безопасно. Присоединяйтесь к регулярным введениям в технику безопасности, проводимыми 3 раза в неделю.</p><ul><li>Вторник: 18:00</li><li>Четверг: 10:00</li><li>Суббота: 10:00</li></ul>',10),d=a('<h1 id="членство" tabindex="-1">Членство <a class="header-anchor" href="#членство" aria-label="Permalink to &quot;Членство&quot;">​</a></h1><p>Являетесь ли вы профессионалом или только пробуете свои силы, членство в ADX даёт вам доступ к инструментам, пространству и сообществу для успешной реализации ваших проектов. Мы предлагаем несколько уровней членства.</p><h2 id="уровни-членства" tabindex="-1">Уровни членства <a class="header-anchor" href="#уровни-членства" aria-label="Permalink to &quot;Уровни членства&quot;">​</a></h2><p>Все уровни включают полный доступ к The Bridge Digital Design Lab, библиотеле инструмента, общему рабочему пространству, выгодам партнёрства, скидкам на классы и услуги такие как 3D печать и лазерная резка.</p><h3 id="членство-в-сообществе" tabindex="-1">Членство в сообществе <a class="header-anchor" href="#членство-в-сообществе" aria-label="Permalink to &quot;Членство в сообществе&quot;">​</a></h3><p>Стань частью нашего творческого сообщества и получай доступ к мастерским по необходимости.</p><h4 id="_50-в-месяц" tabindex="-1">$50 в месяц <a class="header-anchor" href="#_50-в-месяц" aria-label="Permalink to &quot;$50 в месяц&quot;">​</a></h4><p>Доступ к деревянной и металлической мастерской, а также к ремесленной лаборатории &quot;Куб&quot; по необходимости за отдельную плату..</p><h3 id="абонемент-ремесленнои-лаборатории" tabindex="-1">Абонемент Ремесленной лаборатории <a class="header-anchor" href="#абонемент-ремесленнои-лаборатории" aria-label="Permalink to &quot;Абонемент Ремесленной лаборатории&quot;">​</a></h3><p>Неограниченный доступ в ремесленную лабораторию &quot;Куб&quot;. Доступ в мастерские по необходимости за отдельную плату.</p><h4 id="_80-в-месяц" tabindex="-1">$80 в месяц <a class="header-anchor" href="#_80-в-месяц" aria-label="Permalink to &quot;$80 в месяц&quot;">​</a></h4><h3 id="абонемент-свободного-времени" tabindex="-1">Абонемент свободного времени <a class="header-anchor" href="#абонемент-свободного-времени" aria-label="Permalink to &quot;Абонемент свободного времени&quot;">​</a></h3><p>Доступ ко всем мастерским в свободное от основной работы время в будни с 17:00 и все выходные.</p><h4 id="_150-в-месяц" tabindex="-1">$150 в месяц <a class="header-anchor" href="#_150-в-месяц" aria-label="Permalink to &quot;$150 в месяц&quot;">​</a></h4><h3 id="неограниченныи-абонемент" tabindex="-1">Неограниченный абонемент <a class="header-anchor" href="#неограниченныи-абонемент" aria-label="Permalink to &quot;Неограниченный абонемент&quot;">​</a></h3><p>Уделяйте серьезное внимание вашим проектам, пользуясь свободным доступом в мастерские 7 дней в неделю с утра до вечера.</p><h4 id="_200-в-месяц" tabindex="-1">$200 в месяц <a class="header-anchor" href="#_200-в-месяц" aria-label="Permalink to &quot;$200 в месяц&quot;">​</a></h4>',17),u=a('<h1 id="классы" tabindex="-1">Классы <a class="header-anchor" href="#классы" aria-label="Permalink to &quot;Классы&quot;">​</a></h1><p>Смените офисный стол на верстак и попробуйте что-то новенькое. Мы предлагаем классы по деревообработке, металлообработке, обивке, 3D-дизайну, лазерной резке, 3D-печати и многому другому. С ADX вы будете учиться в обстановке взаимопомощи, где размер классов достаточно мал чтобы дать вам достаточно времени для личной работы с нашими умелыми инструкторами. Мы также предлагаем особые групповые занятия для школ и организаций.</p><p>Нестандартные классы стоят от $60/час для членов сообщества и от $75/час для гостей пространства.</p><h1 id="мастерская-деревообработки" tabindex="-1">Мастерская деревообработки <a class="header-anchor" href="#мастерская-деревообработки" aria-label="Permalink to &quot;Мастерская деревообработки&quot;">​</a></h1><ul><li>Отрезная и ленточная пилы</li><li>Токарный станок</li><li>ЧПУ фрезер</li><li>Ленточный и барабанный шлифовальные станки</li><li>Фуговальный и строгальный станки</li><li>Верстаки</li><li>Хранение материалов</li><li>и многое другое!</li></ul><h1 id="мастерская-металлообработки" tabindex="-1">Мастерская металлообработки <a class="header-anchor" href="#мастерская-металлообработки" aria-label="Permalink to &quot;Мастерская металлообработки&quot;">​</a></h1><ul><li>MIG &amp; TIG сварочные аппараты</li><li>Плазменный резак</li><li>Ленточная пила</li><li>Сверлильный станок</li><li>Точильный станок</li><li>Верстаки</li><li>Вертикально-фрезерный станок</li><li>и многое другое!</li></ul><h1 id="мост" tabindex="-1">&quot;Мост&quot; <a class="header-anchor" href="#мост" aria-label="Permalink to &quot;&quot;Мост&quot;&quot;">​</a></h1><ul><li>Стационарные компьютеры</li><li>Рабочие столы</li><li>Лазерный резак</li><li>3D принтер</li><li>Программы для моделирования</li><li>Программы Autodesk</li><li>Офисная канцелярия</li><li>и многое другое!</li></ul><h1 id="куб" tabindex="-1">&quot;Куб&quot; <a class="header-anchor" href="#куб" aria-label="Permalink to &quot;&quot;Куб&quot;&quot;">​</a></h1><ul><li>Инструмент для ювелирных работ</li><li>Промышленная швейная машина</li><li>Инструменты для обивки</li><li>Шитьё одежды</li><li>Небольшая кузница</li><li>Шелкография</li><li>Верстаки</li><li>и многое другое!</li></ul>',11);function c(s,_,p,q,b,m){const l=i;return r(),o("div",null,[n,e(l,{link:"https://www.youtube.com/watch?v=TrlscX5_ozo"}),d,e(l,{link:"https://youtu.be/qmaf3UcCGPg"}),u])}const P=t(h,[["render",c]]);export{k as __pageData,P as default};
